import React from 'react';

function Sessions({ sessionSelection, toggleSlider }) {
    // const sessions = ["Frontend Development", "Backend Development", "FullStack Development"];
    const sessions = [
        { name: "Frontend Development", score: "9.50", lastSession: "3 Nov 22", type: "FND" },
        { name: "Backend Development", score: "9.45", lastSession: "3 Oct 23", type: "FE" },
        { name: "FullStack Development", score: "9.45", lastSession: "3 Oct 23", type: "FE" },
    ];

    return (
        <div className=' grid border rounded-xl text-sm mt-10 mx-5 '>
            <div className=''>
                {sessions.map((session, index) => (
                    <div>
                        <div
                            className=' py-3 border-y flex justify-between px-5 items-center'
                            key={index}
                            onClick={() => sessionSelection(session)}>
                            {session}
                            <p>Score</p>
                            <p>Last session</p>
                            <button className=' float-end pl-3 border-l-2 py-3 text-blue-400 font-semibold' onClick={toggleSlider}>View Details</button>

                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Sessions;
